import heapq
class Solution(object):
    def minimumObstacles(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """
        visit={}
        m,n = len(grid),len(grid[0])
        costD = {}
        dir = [[1,0],[-1,0],[0,1],[0,-1]]
        ic = 0
        if grid[0][0] ==1:
            ic = 1
        st = [(ic,0,0)]
        mn = m*n
        while st:
            cost,x,y =heapq.heappop(st)
            if (cost,x,y) in visit: continue
            visit[(cost,x,y)]=1
            if x == m-1 and y == n-1:
                mn = min(mn,cost)
                return mn
            for dx,dy in dir:
                nx,ny = x+dx,y+dy
                pcost =costD.get((nx,ny),m*n+2)
                if 0<=nx<m and 0<=ny<n and cost < pcost :
                    nc = cost + grid[nx][ny]
                    heapq.heappush(st,(nc,nx,ny))
                    costD[(nx,ny)] = nc

